const ConvertDataForLineChart = (flattenedData) => {
    const convertedData = [];

    flattenedData.forEach((event) => {
      const timestamp = new Date(event.TimeStamp);
      convertedData.push({ x: timestamp, y: event.EventType });
    });

    return convertedData;
  };

  export default ConvertDataForLineChart;
